/**
 * Converts a square Ulam spiral index to an array index.
 *
 */

 export function atos ( i , n ) {

	var s, l, r, L, R, x, y;

	s = Math.sqrt(i) | 0;
	l = s;
	r = s + 1;
	L = l * l;
	R = r * r;
	x = (n - 1) / 2 | 0;
	y = n / 2 | 0;

	if (s % 2 === 1) {
		if (i < (L + R) / 2 | 0) {
			x += (s / 2 | 0) + 1;
			y += (l / 2 | 0) + L - i;
		}
		else {
			x -= (r / 2 | 0) - R + i;
			y -= (s / 2 | 0) + 1;
		}
	}
	else {
		if (i < (L + R) / 2 | 0) {
			x -= (s / 2 | 0);
			y -= (l / 2 | 0) + L - i;
		}
		else {
			x += (r / 2 | 0) + 1 - R + i;
			y += (s / 2 | 0);
		}
	}

	return n * y + x;
}

/**
 * Converts an array index to a square Ulam spiral index.
 *
 */

export function stoa ( i , n ) {

	var line, col, ring_index, side_col, side_line, sub_size;

	line = i / n | 0;
	col = i % n;

	if (n % 2 === 0) {
		line = n - line - 1;
		col = n - col - 1;
	}

	side_col = 1;
	side_line = 1;

	if (col < n - line) {
		ring_index = Math.min(line, col);
	}
	else if (col > line) {
		ring_index = n - col - 1;
		side_line = -1;
	}
	else{
		ring_index = n - line - 1;
		side_col = -1;
	}

	sub_size = n - ring_index * 2;

	return sub_size * sub_size - (sub_size - 1) * 2 + side_line * (line - ring_index) - side_col * (col - ring_index) - 1;

}

